description:
Sorted Music to go with VGHD. 
Version 2, and possibly the last one.

Assorted collection that you will surely appreciate.


You probably want only the 3 &quot;!!&quot; marked folders. Choose if you want to download the others. 
'VA-SELECTED' and 'INSTRUMENTALS' are the songs you are looking for.

Audio Clips:
'Single length' mean either a single beat or a few beats of the song's rhythm, carefully cropped. Try putting your player in Repeat mode and playing each of these. They will sound seamlessly continuous.

Unless you are lazy enough to do it by yourself, you might not need 'repeats' and 'amplified' folders.
Tempo shift is just what it means.

Will seed full speed as long as possible. 

Enjoy!




